state.code:
graph LR
    A[User Registration]:::start --> B{User Type}:::decision
    B -- Consumer --> C[Buy Order]:::consumer
    B -- Producer --> D[Sell Order]:::producer
    B -- Prosumer --> E[Buy/Sell Order]:::prosumer
    C --> F[Order Placed]:::process
    D --> F
    E --> F
    F --> G[Owner Executes]:::owner
    G --> H[Sort Orders]:::process
    H --> I{Process Orders}:::decision
    I --> J[Match Found?]:::decision
    J -- Yes --> K[Execute Transaction]:::process
    J -- No --> L[Next Order]:::process
    L --> I
    I --> M{Done?}:::decision
    M -- Yes --> N[End]:::end
    M -- No --> I

    classDef start fill:#87CEEB,stroke:#000,stroke-width:2px;
    classDef decision fill:#FFD700,stroke:#000,stroke-width:2px;
    classDef process fill:#90EE90,stroke:#000,stroke-width:2px;
    classDef consumer fill:#FFA07A,stroke:#000,stroke-width:2px;
    classDef producer fill:#FF6347,stroke:#000,stroke-width:2px;
    classDef prosumer fill:#DDA0DD,stroke:#000,stroke-width:2px;
    classDef owner fill:#1E90FF,stroke:#000,stroke-width:2px;
    classDef end fill:#32CD32,stroke:#000,stroke-width:2px;
